【特長】<br>●角度可変（0°～90°）は5段階です。<br>●ヘッドバンドは調節可能です。<br>●センターヘッドバンドを外せばヘルメットにも簡単に装着できます。<br>●ライト本体へ電池装填タイプです。<br><br><br>【仕様】<br>●全光束(lm):最大30<br>●幅(mm):56<br>●奥行(mm):75<br>●高さ(mm):56<br>●質量(g):60<br>●電源:単4形乾電池（3個）別売<br>●アルカリ乾電池使用時最大点灯時間1球:約80時間、2球:約42時間、3球:約28時間<br>●全光束:1球 10lm、2球 20lm、3球 30lm<br>●防滴仕様<br><br>【材質／仕上】<br>●本体:プラスチック<br><br>【入数】<br><br><br>【質量】<br>60g<br><br>【JANコード】<br>4989999034394<br><br>【セット内容】<br>●ヘッドバンド<br><br>【注意】●電球交換できません。●LEDは決して直視しないでください。<br><br>【メーカー名】<br>トラスコ中山（株）<br><br>【生産国】<br>中国<br><br><br><font size='1'>【販促用キーワード】/ 通販/ 価格 / お買い得商品 / 人気商品 / 業務用・プロ用 / 楽天市場 / ポイント消化 / 送料無料 特典あり※一部商品地域除く / 楽天プレミアム・学割 対象 /</font><style type="text/css">
