■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">シマノ (shimano) ワールドシャウラ ツアーエディション (WORLD SHAULA TOUR EDITION) 2754R-5 / バスロッド<br /><br />仕舞寸法54cm以下。<br />機内に持ち込めるワールドスペック。<br /><br />シマノが贈るワールドスタンダードロッドとして不動の地位を築いたワールドシャウラのモバイルバージョンがワールドシャウラ ツアーエディション。飛行機の機内へ持ち込めるコンパクトさで、ワールドシャウラのハイスペックを国内外へ気軽に持ち出せるようになりました。ピースの数を感じさせない軽さ、そして丈夫さはまさに型破り。かつてはどことなく我慢して使っていたパックロッドですが、ダブルX 構造を採り入れ、ファイティンググリップTypeRなど先進の機構を各部に導入したワールドシャウラは、どこに行ってもクオリティの高い釣りを展開できる良質のフリースタイルロッド。コンパクトでも可能性は無限大、舞台は世界中のフィールドです。<br /><br />2754R-5<br />オフショアやショアからのロングキャストゲームで世界中の大型魚を狙うドリームロッドです。設計上の制限の多いパックロッドながら、パワーロスの少ないスムーズな曲がりを実現。大口径ガイドを少なめにセッティングすることでロングキャストを可能にしました。大型トップやミノー、重めのテキサスリグ、スピナーベイトやビッグベイトまで扱える懐の深いモデルです。<br /><br />■スパイラルX<br />■ハイパワーＸ<br />■ベイト：ファイティンググリップType R/CI4+<br />■スピニング：天然木オリジナルシート<br />■チタンフレームSiCガイド<br />■トルザイトリング（2650FF-4、2651F-4）<br />■専用竿袋 <br /><br />■発売年：2017年</font></td></tr></table><STYLE type="text/css">
